import { BrowserRouter, Route, Routes, Link} from 'react-router-dom';
import React, {useState} from 'react';
import Modal from 'react-modal';
import './mainBTN.css';

function Main() {
  const [modalIsOpen, setModalIsOpen] = useState(false);


  return (
    <body>
      <h1 className="mainName">P:LOW</h1>
      <div className="slogan">
        <h2>헌혈자 수 누계</h2>
        <h2 className="num">8,232</h2>
        <h2>헌혈로 세상의 가치를 잇다.</h2>
      </div>
      <div>
        <img className="mainLogo" src="img/logo.png" alt="로딩 실패" width="150" height="100"/>
      </div>
      <div className='btn-box'>
        <Link to ="/user">
          <button className="main-btn" onClick={() => setModalIsOpen(true)}>사용자</button>
        </Link>
        <Link to ="/institute">
          <button className="main-btn" onClick={() => setModalIsOpen(true)}>조회 기관</button>
        </Link>
        <Link to ="/blood">
          <button className="main-btn" onClick={() => setModalIsOpen(true)}>헌혈 기관</button>
        </Link>
      </div>
    </body>
  );
}

export default Main;
